import React from "react";
import {Card,Container,CardBody,CardTitle,CardText,CardImg} from "reactstrap";
import {FaEnvelope,FaMapMarkedAlt,FaPhone,FaPortrait} from "react-icons/fa"


const MyCard = ({details})=>{
    return(
        <Card>
            <CardImg src={details.picture?.large}/>
                <CardBody>
                <CardTitle> {details.name?.first}</CardTitle>
                <CardText>{details.phone}</CardText>
                </CardBody>
        </Card>
    )
}



export default MyCard;
